<body>
	<header class="header">
		<a class="logo" href="/">Feeed</a>
		<button class="floatingButton settingsToggler settings-toggle">
			<svg class="ico"><use href="#i-cog" /></svg>
		</button>
		<button class="floatingButton themeSwitcher">
			<svg class="ico light-invisible"><use href="#i-sun2" /></svg>
			<svg class="ico dark-invisible"><use href="#i-moon" /></svg>
		</button>
	</header>

	<main class="feed">
		<div class="posts"></div>
		<div class="button paginator narrow invisible">Load more</div>
		<div class="noPosts invisible">
			<svg class="ico noPosts-ico"><use href="#i-sad" /></svg>
			<p>No posts matches the set filter</p>
			<div class="button narrow clearFilter">Clear filter</div>
		</div>
	</main>
	<div class="loader"></div>

	<aside class="settings">
		<div class="settings-backdrop settings-toggle"></div>
		<div class="settings-menu">
			<button class="floatingButton settings-x settings-toggle"><svg class="ico"><use href="#i-x" /></svg></button>
			<h2 class="settings-title">Settings</h2>
			<div class="filter">
				<h3 class="filter-title">Active feeds</h3>
				<div class="filterItems filterItems-feed"></div>
			</div>
			<div class="filter">
				<h3 class="filter-title">Feed categories</h3>
				<div class="filterItems filterItems-category"></div>
			</div>
			<div class="filterButton button disabled">Apply</div>
			<div class="button outline invisible clearFilter clearFilterInSettings">Clear filter</div>
			<div class="lastUpdate">Updated: <strong class="lastUpdate-time"></strong></div>
		</div>
	</aside>

